// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmSlider 
} from '@vime/core';

import { define } from '../lib';


define('vm-slider', VmSlider);


export interface SliderProps extends JSX.VmSlider, HTMLAttributes<HTMLVmSliderElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmSliderElement, SliderProps>(
  'vm-slider',
  new Set(['step','min','max','value','valueText','label']),
);
